import React, { useState } from "react";
import { motion } from "framer-motion";

// ---------------- Bug Hunt ----------------
function BugHunt({ onWin }) {
  const [score, setScore] = useState(0);

  const handleClick = () => {
    const newScore = score + 1;
    setScore(newScore);
    if (newScore === 3) onWin();
  };

  return (
    <motion.div
      onClick={handleClick}
      className="fixed bottom-32 left-10 cursor-pointer text-4xl select-none"
      title="Catch me!"
      animate={{ x: [0, 50, -50, 0], y: [0, -20, 20, 0] }}
      transition={{ repeat: Infinity, duration: 6 }}
    >
      üêû
    </motion.div>
  );
}

// ---------------- Test Demo ----------------
function TestDemo() {
  const [logs, setLogs] = useState([]);
  const testLogs = [
    "Running tests on E-commerce Project...",
    "‚úÖ Login test passed",
    "‚úÖ Add to cart test passed",
    "‚úÖ Checkout flow passed",
    "üöÄ All tests successful!"
  ];

  const runTests = async () => {
    setLogs([]);
    for (let i = 0; i < testLogs.length; i++) {
      await new Promise((r) => setTimeout(r, 1000));
      setLogs((prev) => [...prev, testLogs[i]]);
    }
  };

  return (
    <div className="mt-4">
      <button
        onClick={runTests}
        className="bg-indigo-600 text-white px-3 py-1 rounded shadow hover:bg-indigo-700"
      >
        ‚ñ∂Ô∏è Run Tests
      </button>
      <div className="bg-black text-green-400 font-mono text-sm mt-2 p-2 rounded h-32 overflow-y-auto">
        {logs.map((line, i) => (
          <div key={i}>{line}</div>
        ))}
      </div>
    </div>
  );
}

// ---------------- Fun Fact Generator ----------------
function FunFacts() {
  const facts = [
    "üß™ 80% of software bugs are caused by human errors.",
    "üíª Selenium was originally named after a joke about Mercury poisoning.",
    "üöÄ First software bug was an actual moth stuck in a computer in 1947.",
    "‚ö° Automation can reduce testing time by 60% on average.",
    "üåê Python is the most popular language for test automation today."
  ];

  const [fact, setFact] = useState("Click the button to see a fun fact!");

  const generateFact = () => {
    const random = facts[Math.floor(Math.random() * facts.length)];
    setFact(random);
  };

  return (
    <div className="p-4 bg-indigo-100 dark:bg-indigo-900 rounded-xl shadow mt-6 text-center">
      <p className="mb-2 text-gray-800 dark:text-gray-200">{fact}</p>
      <button
        onClick={generateFact}
        className="bg-indigo-600 text-white px-3 py-1 rounded shadow hover:bg-indigo-700"
      >
        üé≤ New Fact
      </button>
    </div>
  );
}

// ---------------- Portfolio Main ----------------
export default function Portfolio() {
  const [dark, setDark] = useState(false);

  const projects = [
    {
      title: "Selenium Hybrid Automation Framework",
      desc: "Hybrid framework using POM + Data-Driven approach with Jenkins CI/CD integration."
    },
    {
      title: "E-commerce Web App",
      desc: "Full-stack MERN project with cart, login, and payment system."
    }
  ];

  return (
    <div className={dark ? "dark" : ""}>
      <div className="min-h-screen bg-gray-50 dark:bg-gray-900 text-gray-900 dark:text-gray-100 transition-colors">

        {/* Header */}
        <header className="p-6 bg-indigo-600 text-white text-center shadow-lg flex justify-between items-center">
          <div>
            <h1 className="text-3xl font-bold">Ajjayya G V üöÄ</h1>
            <p>QA Automation Engineer | Python | Selenium | React</p>
          </div>
          <button
            onClick={() => setDark(!dark)}
            className="bg-white text-indigo-600 dark:bg-gray-800 dark:text-yellow-300 px-3 py-1 rounded shadow"
          >
            {dark ? "‚òÄÔ∏è Light" : "üåô Dark"}
          </button>
        </header>

        {/* Projects */}
        <section className="p-6">
          <h2 className="text-2xl font-semibold mb-4">Projects</h2>
          <div className="grid md:grid-cols-2 gap-6">
            {projects.map((p, i) => (
              <motion.div 
                key={i}
                initial={{ opacity: 0, y: 30 }} 
                whileInView={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.5 }}
                className="p-4 bg-white dark:bg-gray-800 rounded-xl shadow"
              >
                <h3 className="text-lg font-bold">{p.title}</h3>
                <p className="text-sm">{p.desc}</p>
              </motion.div>
            ))}
          </div>
        </section>

        {/* Test Demo */}
        <section className="p-6">
          <h2 className="text-2xl font-semibold mb-2">Automation Test Demo</h2>
          <TestDemo />
        </section>

        {/* Fun Fact Generator */}
        <section className="p-6">
          <h2 className="text-2xl font-semibold mb-2">Fun Facts</h2>
          <FunFacts />
        </section>

        {/* Bug Hunt */}
        <BugHunt onWin={() => alert("üéâ You caught all bugs! Great tester skills!")} />

        {/* Footer */}
        <footer className="p-4 text-center text-sm text-gray-500 dark:text-gray-400">
          Made with ‚ù§Ô∏è by Ajjayya | QA Engineer
        </footer>
      </div>
    </div>
  );
}
